import React from "react";
import { Box, Typography, Button, Grid, Card, CardContent } from "@mui/material";
import { PlayCircleOutline, Settings, Person, Code } from "@mui/icons-material";

const HomePage = () => {
  return (
    <Box sx={{ minHeight: "100vh", bgcolor: "#f5f5f5", display: "flex", flexDirection: "column", alignItems: "center", justifyContent: "center", p: 4 }}>

      {/* Header Section */}
      <Typography variant="h2" fontWeight="bold" color="primary" gutterBottom>
        CMS
      </Typography>
      <Typography variant="h5" color="secondary" gutterBottom>
        Lorem Ipsum Dolor Sit
      </Typography>
      <Typography variant="body1" color="text.secondary" textAlign="center" maxWidth={600}>
        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed diam nonummy nibh euismod tincidunt ut
        laoreet dolore magna aliquam erat volutpat.
      </Typography>

      {/* Hero Section */}
      <Grid container spacing={4} justifyContent="center" sx={{ mt: 4 }}>
        {/* Left Content */}
        <Grid item xs={12} md={5}>
          <Typography variant="body1" color="text.secondary">
            ✅ Lorem ipsum dolor sit amet, consectetur adipiscing elit.
          </Typography>
          <Typography variant="body1" color="text.secondary">
            ✅ Sed diam nonummy nibh euismod tincidunt ut laoreet dolore.
          </Typography>
          <Button variant="contained" color="primary" sx={{ mt: 3 }}>
            Start Now
          </Button>
        </Grid>

        {/* Right - Feature Section */}
        <Grid item xs={12} md={5} container spacing={2}>
          {[
            { icon: <PlayCircleOutline fontSize="large" color="primary" />, text: "Quick Start" },
            { icon: <Settings fontSize="large" color="secondary" />, text: "Easy Setup" },
            { icon: <Person fontSize="large" color="success" />, text: "User Friendly" },
            { icon: <Code fontSize="large" color="warning" />, text: "Developer Ready" }
          ].map((feature, index) => (
            <Grid item xs={6} key={index}>
              <Card sx={{ display: "flex", alignItems: "center", p: 2, boxShadow: 3 }}>
                {feature.icon}
                <CardContent>
                  <Typography variant="h6">{feature.text}</Typography>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Grid>

      {/* Footer */}

    </Box>
  );
};

export default HomePage;
